  const img = require(`@/assets/${num}.jpg`)
  const background = {
    background: `url(${img}) no-repeat`,
    backgroundSize: 'cover',
    backgroundAttachment: 'fixed',
    backgroundColor: '#fff'
  }
  return background
}

